import React from "react";
import { Col, Container, Row } from "react-bootstrap";

const FiveDays = () => {
  return (
    <Container>
      <Row>
        <Col>
          <Row>Days : Saterday</Row>
          <Row>Temp: 29s</Row>
          <Row>Wind: 17km</Row>
          <Row>water: 90%</Row>
        </Col>
      </Row>
    </Container>
  );
};

export default FiveDays;
